--
-- Table structure for table `RecruitInfo`
--

DROP TABLE IF EXISTS `RecruitInfo`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `RecruitInfo` (
  `RoundSerialNo` int(11) NOT NULL COMMENT '募集ID:通番',
  `MemberID` char(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '主催者ID',
  `CourseID` char(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'コースID',
  `StartCourse` int(11) NOT NULL COMMENT 'スタートコース:Out/In',
  `PlayDate` char(8) COLLATE utf8_unicode_ci NOT NULL COMMENT 'プレイ日',
  `StartTime` char(17) COLLATE utf8_unicode_ci NOT NULL COMMENT 'スタート時間:セルフ／キャディ付き',
  `PlayStyle` varchar(256) COLLATE utf8_unicode_ci NOT NULL COMMENT 'プレースタイル',
  `PlayFee` int(11) NOT NULL COMMENT 'プレー料金:総額',
  `LunchFlag` int(11) NOT NULL COMMENT 'ランチ含む',
  `RoundDetails` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '予約詳細',
  `RecruitNum` int(11) NOT NULL COMMENT '募集人数:1-3',
  `RecruitRange` int(11) DEFAULT '1' COMMENT '募集範囲:1：一般、2：友人、3：親友',
  `Coments` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '参加者へのコメント',
  `CloseDate` char(17) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '締切日時',
  `PushFlag` char(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '通知希望フラグ:募集範囲が2、3の場合のみ適用',
  `Status` int(11) DEFAULT NULL COMMENT '募集進行状況:0-3：残り人数\n-1：主催者がキャンセルした\n-2：募集締切（時間になったか、主催者が手動で）',
  `DelFlg` int(11) DEFAULT '0',
  `RegDate` char(17) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '登録日時',
